	// test full writes
	for i, test := range tests {
		buf := bytes.Buffer{}
		aes, err := newAes128CbcWriter(&buf, commonKey, commonIV)
		if err != nil {
			t.Fatalf("error making writer: %v", err)
		}

		if n, err := aes.Write(test.plaintext); err != nil {
			t.Errorf("error writing test %d: %v", i, err)
		} else if n != len(test.plaintext) {
			t.Errorf("short write while writing test %d: %d instead of %d", i, n, len(test.plaintext))
		} else if err := aes.Close(); err != nil {
			t.Errorf("error closing test %d: %v", i, err)
		} else if bytes.Compare(buf.Bytes(), test.ciphertext) != 0 {
			t.Errorf("ciphertext mismatch in test %d: expected %x, got %x", i, test.ciphertext, buf.Bytes())
		}
	}

	// test buffering by repeating the last test with every Write() size
	test := tests[len(tests)-1]
	for i := 1; i < len(test.plaintext); i++ {
		buf := bytes.Buffer{}
		aes, err := newAes128CbcWriter(&buf, commonKey, commonIV)
		if err != nil {
			t.Fatalf("error making writer: %v", err)
		}

		data := test.plaintext
		for len(data) > 0 {
			n := i
			if n > len(data) {
				n = len(data)
			}
			chunk, remaining := data[:n], data[n:]
			data = remaining
			if _, err := aes.Write(chunk); err != nil {
				t.Errorf("error writing buffering test %d: %v", i, err)
			}
		}

		if err := aes.Close(); err != nil {
			t.Errorf("error closing buffering test %d: %v", i, err)
		} else if bytes.Compare(buf.Bytes(), test.ciphertext) != 0 {
			t.Errorf("ciphertext mismatch in buffering test %d: expected %x, got %x", i, test.ciphertext, buf.Bytes())
		}
	}
